import React from "react";
import img_overlay from "./img/birds_eye.jpg";
import GoldenRatioOverlay from "./img/goldenratiooverlay.jpg";

function ImgOverlay() {
  return (
    <div className="img_overlay">
      <div className="img_overlay_content">
        <img src={GoldenRatioOverlay} alt="" />
        <p>Buy or Rent</p>
        <h2>Looking to buy or rent a property?</h2>
        <h3>Lorem Real Estate provides excellent pricing!</h3>
        <div className="button_flex">
            <a href="#!" className="img_overlay_button">Buy or Rent</a>
            <a href="#!" className="img_overlay_button iob_2">Browse Properties</a>
        </div>
      </div>
    </div>
  );
}

export default ImgOverlay;
